import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import SignUpUser from './component/SignpUser';
import Dashboard from './component/Dashboard';
import Updateuser from './component/Updateuser';
import Story from './component/Story';
import Home from './component/Home';
import { Redirect } from 'react-router-dom';
import LoginUser from './component/LoginUser'



function App(props) {
  return (
    <>
      <BrowserRouter>
      <Route exact path="/">
          {LoginUser ? <Redirect to="/dashboard" /> : <LoginUser />}
        </Route>
        <Route path="/" render={(props) => { return (<Home  {...props} />) }} ></Route>
        <Route path="/SignUpUser" render={(props) => { return (<SignUpUser  {...props} />) }} ></Route>
        <Route path="/Dashboard" render={(props) => { return (<Dashboard  {...props} />) }} ></Route>
        <Route path="/Updateuser" render={(props) => { return (<Updateuser  {...props} />) }} ></Route>

      </BrowserRouter>
    </>
  );
}

export default App;
